import React from 'react'

 const CommentsList = (props) => {
     const {comments}=props
  comments.map((item, i) =>{
    const {user, text} =item;
    return(
      <div>
        <ul>
          <li key={i}>{item.user}</li>
          <li>{text}</li>
        </ul>
      </div>
    )
  })

}
export default CommentsList;
